import {useState} from 'react';

function Home(){
    return <Contador />
}

function Contador(){
    const [contador, setContador] = useState(1);

    function contar(){
        setContador(contador+1);
    }

    function renderizar(){
        <div>
            <div>{contador}</div>
            <button onclick={contar}>Contar!</button>
        </div>
    }

    return renderizar; 
}

export default Home
